di-font-weight:normal\">Druhý březnový týden\r\nse každoročně nese ve znamení dvou souběžně probíhajících etapových závodů. Na\r\nnašem webu jste se mohli dočíst o dvou úvodních etapách italského Tirrena\r\nAdriatice. My se ale dnes budeme věnovat závodu za Paříž - Nice, který měl dnes\r\nna programu týmovou časovku. Jednalo se již o třetí závodní den na území\r\nFrancie, po němž může oslavovat týmové vítězství nizozemská sestava Visma Lease\r\na Bike.</b></p>\r\n\r\n<p class=\"MsoNormal\">Ještě před detailním popisem dnešní časovky si krátce\r\nshrneme úvodní dvě etapy. <b style=\"mso-bidi-font-weight:normal\">Obě skončily\r\nhromadným dojezdem</b>. V obou z nich jsme mohli sledovat precizní práci\r\nsprinterského vlaku týmu Soudal Quick-Step, který dvakrát <b style=\"mso-bidi-font-weight:\r\nnormal\">připravil famózní pozici pro Tima Merliera.</b> Ten samozřejmě\r\nnezaváhal a připsal si páté a šesté vítězství sezóny. Do dnešní časovky tak\r\nMerlier vstupoval ve žlutém dresu lídra závodu.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Na <b style=\"mso-bidi-font-weight:normal\">osmadvacetikilometrovou\r\nčasovku v centrálním masivu Francie </b>se týmy začaly postupně vydávat v\r\n14:30. Specifikum této týmové časovky nespočívalo pouze<span style=\"mso-spacerun:yes\">&nbsp; </span>v jejím zvlněném terénu. <b style=\"mso-bidi-font-weight:\r\nnormal\">Čas týmu se počítal dle času prvního závodníka</b>. Zbylí jezdci\r\nobdrželido celkového pořadí takový čas, v jakém projeli cílem oni sami. Díky\r\ntomu jsme <b style=\"mso-bidi-font-weight:normal\">viděli několik zajímavých\r\ntaktických prvků</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Jak jeden z prvních týmu se na trať vydala australská stáj Jayco\r\nAlula. Z ní jako první <b style=\"mso-bidi-font-weight:normal\">finišovala\r\ndvojice Australanů Michael Matthews a Ben O\'Connor</b>. Ti trasu projeli\r\nprůměrnou rychlostí 55,5 km/h a čas zastavili na hodnotě 30 min a 41s. <br></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Čas australského týmu dlouho zůstával nepřekonán. <b style=\"mso-bidi-font-weight:normal\">To změnila až nizozemská stáj Visma Lease a\r\nBike</b>. Ta na rovině vsadila na své domestiky, kteří na silnici nechali úplně\r\nvšechno ve prospěch svých lídrů. Z toho pak benefitovala <b style=\"mso-bidi-font-weight:\r\nnormal\">dvojice Vingegaard aJorgenson, která zaznamenala o 14 sekund rychlejší\r\nčas než stáj Jayco Alula.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Po nizozemské stáji bylo na startu ještě několik týmů.\r\nŽádnému týmu se ale <b style=\"mso-bidi-font-weight:normal\">čas 30:27 nepodařilo\r\npřekonat.</b> Nejvíce se k této hodně přiblížila stáj Red Bull Bora Hansgrohe, která\r\nnakonec brala třetí místo. <b style=\"mso-bidi-font-weight:normal\">Vítězství\r\ntýmu Visma Lease a Bike</b> bylo zpečetěno po dojezdu Soudalu Quick-Step (10.\r\nmísto).</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Díky týmovému triumfu se <b style=\"mso-bidi-font-weight:\r\nnormal\">do čela celkového pořadí vyhoupl obhájce vítězství Matteo Jorgenson</b>.\r\nPouhých 6 sekund za ním mu <b style=\"mso-bidi-font-weight:normal\">z druhého\r\nmísta kryje záda jeho týmový kolega Jonas Vingegaard</b>. Třetí Matthews a\r\nčtvrtý O\'Connor ztrácí jedenadvacet sekund na vedoucího Jorgensona.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"><br></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-spacerun:yes\">&nbsp;</span>Myslíte, že Jorgenson obhájí loňské vítězství?</b></p>\r\n\r\n<div><br></div>', 6, 'vyhra-vismy-v-tymove-casovce-paris-nice-katapultovala-jorgensona-do-zluteho-dresu');